import classes from './ArchiveClasses.module.css';

const ArchiveClasses = ({href, children, ...props}) => {
  return (
      <div {...props} className={classes.Classes}>
          <ArchiveItem href={href}>{children}</ArchiveItem>
          <ArchiveItem href={href}>10 класс</ArchiveItem>
          <ArchiveItem href={href}>11 класс</ArchiveItem>
      </div>
  )
}

export default ArchiveClasses;

const ArchiveItem = ({href, children, ...props}) => {
  return (
    <a href={href} {...props} className={classes.ClassesItem}>
      {children}
    </a>
  )
}
